import React from 'react';
import withBreadcrumbs from 'react-router-breadcrumbs-hoc';

const Breadcrumbs = (breadcrumbs: any) => (
    <React.Fragment>
        {breadcrumbs.map((breadcrumb: any) => breadcrumb)}
    </React.Fragment>
)

export default withBreadcrumbs()(Breadcrumbs);
